import React from "react";

const Hobbies = () => {
  return (
    <div>
      <div>
        <h3>Amateur Astronomy</h3>
        <p>
          I have three different telescopes that I enjoy using to look out into
          the sky. I feel most at peace when contemplating the mysteries of the
          universe.
        </p>
      </div>
      <div>
        <h3>Creative Writing</h3>
        <p>
          I enjoy expressing myself through creative writing. My favorite
          stories to write are spooky horror stories.
        </p>
      </div>
      <div>
        <h3>Nature Hiking</h3>
      </div>
    </div>
  );
};

export default Hobbies;
